%spark.pyspark

def discretize_results(result):
    group = -1
    if result > 0 and result <= 125:
        group = 0
    elif result > 125 and result <= 250:
        group = 1
    elif result > 250 and result <= 375:
        group = 2
    elif result > 375 and result <= 500:
        group = 3
    return group

spark.udf.register('discretize_results', discretize_results)

cleandf = spark.sql("select estu_edad, estu_genero, estu_numero_libros, estu_reside_mcpio, coalesce(fami_educa_padre, 0) as fami_educa_padre, coalesce(fami_educa_madre, 0) as fami_educa_madre, coalesce(fami_num_hermanos, 0) as fami_num_hermanos, coalesce(fami_estrato_vivienda, 0) as fami_estrato_vivienda, coalesce(fami_personas_hogar, 0) as fami_personas_hogar, fami_internet, fami_servicio_television, fami_computador, fami_automovil, coalesce(fami_ingreso_fmiliar_mensual, 0) as fami_ingreso_fmiliar_mensual, discretize_results(punt_global) as punt_global from saberpro where discretize_results(punt_global) != -1")

cleandf.createOrReplaceTempView('saberpro_clean')
cleandf.cache()
